import './App.css';
import { BrowserRouter, Route, Routes, Router } from 'react-router-dom';
import Main from './pages/Main';
import Login from './pages/Login'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Main/>}/>
          <Route path='login' component={<Login/>}/>
        </Routes>
      </BrowserRouter>


    </div>
  );
}

export default App;
